import React from 'react'
import BoostItem from './BoostItem'

const DayBoosts = ({
	boostData,
	handleBoostClick,
	userData,
	calculateTimeLeft,
	formatTimeLeft,
}) => {
	return (
		<div className='day-boosts'>
			{boostData.map(boost => (
				<BoostItem
					key={boost.name}
					boost={boost}
					handleBoostClick={handleBoostClick}
					userData={userData}
					calculateTimeLeft={calculateTimeLeft}
					formatTimeLeft={formatTimeLeft}
				/>
			))}
		</div>
	)
}

export default DayBoosts
